// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";

import "./BrazilCarbonCredit.sol";

contract BRZCO2Sale is Ownable {
    // Enums
    enum Status {notStarted, inProgress, paused, closed} 

    // Public variables
    BrazilCarbonCredit public tokenContract;
    Status public icoStatus;
    uint public tokensForSale;
    uint public soldTokens;
    uint public startOfSale;
    uint public endOfSale;
    string public price;
    address[] public investorAddresses;

    mapping (address => uint256) public investorBalances;

    // Internal variables
    bool internal setedContract = false;

    // Events
    event Decrease(address _owner, uint _less);
    event Increase(uint tokensForSale );
    event Price(address msgSender, string price, string _newPrice);
    event Received(address, uint);
    event Sell(address _buyer, uint _amount);  

    // Modifiers
    modifier canSetContract() {
        require(
            !setedContract,
            "Set the token contract is not allowed!"
        );
        _;
    }

    modifier onlyWhileOpen() {
        require(
            block.timestamp <= endOfSale,
            "ICO closed!"
        );
        _;
    }

    // Constructor
    constructor(uint _startOfSale, uint _endOfSale, string memory _price) {
        require(
            _endOfSale > block.timestamp && _endOfSale > _startOfSale,
            "Wrong end of sale date!"
        );

        startOfSale = _startOfSale;
        endOfSale = _endOfSale;
        price = _price;

        if (block.timestamp < startOfSale) {
            icoStatus = Status.notStarted;
        } else {
            icoStatus = Status.inProgress;
        }
    }

    // Receive function
    receive() external payable {
        emit Received(msg.sender, msg.value);
    }

    // External functions
    function decreaseTokensForSale(address _owner, uint _less) external onlyOwner {
        require(
            _less <= tokenContract.balanceOf(address(this)),
            "More tokens than available balance!"
        );
        tokenContract.transfer(_owner, _less);
        tokensForSale = tokenContract.balanceOf(address(this));
        emit Decrease(_owner,_less);
    }

    function closeSale() external onlyOwner {
        require(
            tokenContract.transfer(
                msg.sender,
                tokenContract.balanceOf(address(this))
            ),
            "Unable to transfer tokens to admin!"
        );

        selfdestruct(payable(msg.sender));
    }

    function increaseTokensForSale() external onlyOwner {
        require(
            tokensForSale < tokenContract.balanceOf(address(this)),
            "No tokens have been added to the contract!"
        );

        tokensForSale = tokenContract.balanceOf(address(this));
        emit Increase(tokensForSale);
    }

    function managePrice(string memory _newPrice) external onlyOwner {
        price = _newPrice;
        emit Price(msg.sender, price, _newPrice);
    }

    function manageTime(uint _newEndOfSale ) external onlyOwner {
        require(
            _newEndOfSale > block.timestamp && _newEndOfSale > startOfSale, 
            "Wrong end of sale date!"
        );

        endOfSale = _newEndOfSale;
    }

    function setTokenContract(BrazilCarbonCredit _tokenContract) external onlyOwner canSetContract {
        tokenContract = _tokenContract;
        setedContract = true;
        tokensForSale = tokenContract.balanceOf(address(this));      
    }

    function withdraw() external onlyOwner {
        require(
            address(this).balance > 0,
            "Insuficient funds!"
        );

        uint amount = address(this).balance;
        // sending to prevent re-entrancy attacks
        address(this).balance - amount;
        payable(msg.sender).transfer(amount);
    }

    // External functions that are view
    function getBalance() external view returns(uint) {
        return address(this).balance;
    }

    // Public functions
    function buyTokens(uint _numberOfTokens, uint _tokenPrice) public payable onlyWhileOpen {
        icoStatus = getCurrentStatus();
        if (icoStatus == Status.notStarted && block.timestamp >= startOfSale) {
            icoStatus = Status.inProgress;
        }

        if (icoStatus == Status.inProgress && block.timestamp > endOfSale) {
            icoStatus = Status.closed;
        }

        require(
            icoStatus == Status.inProgress,
            "ICO is not in progress!"
        );

        require(
            msg.value == _numberOfTokens * _tokenPrice,
            "Number of tokens does not match with the value!"
        );

        uint scaledAmount = _numberOfTokens * 10 ** tokenContract.decimals();
        require(
            tokensForSale >= _numberOfTokens * 10 ** tokenContract.decimals(),
            "The contract does not have enough tokens!"
        );

        soldTokens += _numberOfTokens;
        tokensForSale -= _numberOfTokens * 10 ** tokenContract.decimals();
        emit Sell(msg.sender, _numberOfTokens);
        require(
            tokenContract.transfer(payable(msg.sender), scaledAmount),
            "Some problem with token transfer!"
        );
        investorBalances[msg.sender] += _numberOfTokens;
        investorAddresses.push(msg.sender);    
    }

    function paused() public onlyOwner onlyWhileOpen {
        icoStatus = Status.paused;
    }

    function unpaused() public onlyOwner onlyWhileOpen{
        if (block.timestamp < startOfSale) {
            icoStatus = Status.notStarted;
        } else {
            icoStatus = Status.inProgress;
        }
    }

    // Public functions that are view
    function getCurrentStatus() public view returns (Status) {
        if (icoStatus == Status.paused) {
            return Status.paused;
        } else if (block.timestamp >= startOfSale && block.timestamp <= endOfSale) {
            return Status.inProgress;
        } else if (block.timestamp > endOfSale) {
            return Status.closed;
        } else {
            return Status.notStarted;
        }
    }
}
